const Hero = () => {
  return (
    <div className='bg-yellow-300'>
      <div className='container mx-auto px-4'>
        <div className='flex flex-wrap'>
         
          <div className='w-full md:w-2/3 p-4'>
            <h2 className='text-2xl font-bold mb-4'>Welcome to our site!</h2>
            <p className='mb-4'>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed auctor, magna a volutpat laoreet, velit velit venenatis nisl, vel aliquet lorem nisi et sapien.</p>
            
            <button className='bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded'>Learn More</button>
          
          </div>
        </div>
      </div>
    </div>
  )
}

export default Hero;
